import{_ as t,o as e,c as l,N as a}from"./chunks/framework.27c7f8b4.js";const i="/lz-docs/assets/increase-money-center.fc090c26.png",u=JSON.parse('{"title":"提额中心首页","description":"","frontmatter":{},"headers":[],"relativePath":"docs/yijie_pages/increase_money_center.md","lastUpdated":1702606418000}'),n={name:"docs/yijie_pages/increase_money_center.md"},r=a('<h1 id="提额中心首页" tabindex="-1">提额中心首页 <a class="header-anchor" href="#提额中心首页" aria-label="Permalink to &quot;提额中心首页&quot;">​</a></h1><h2 id="页面数据-不包含周周打卡" tabindex="-1">页面数据(不包含周周打卡) <a class="header-anchor" href="#页面数据-不包含周周打卡" aria-label="Permalink to &quot;页面数据(不包含周周打卡)&quot;">​</a></h2><ul><li>接口：/userAuth/suppl/getUserInfo（志轩）</li></ul><table><thead><tr><th style="text-align:left;">字段</th><th style="text-align:center;">类型</th><th style="text-align:center;">含义</th><th style="text-align:left;">前端逻辑</th></tr></thead><tbody><tr><td style="text-align:left;">authSupplInfos</td><td style="text-align:center;">{}[]</td><td style="text-align:center;">所有提额记录数据（包含周周打卡记录）</td><td style="text-align:left;">/nothing</td></tr><tr><td style="text-align:left;">authSupplItems[0].switchStatus</td><td style="text-align:center;">1/0</td><td style="text-align:center;">开启、关闭</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;">authSupplItems[0].url</td><td style="text-align:center;">&#39;/auth/license?type=tax&#39;</td><td style="text-align:center;">跳到对应页面</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;">authSupplItems</td><td style="text-align:center;">{}[]</td><td style="text-align:center;">所有提额选项（含已提额成功的选项）</td><td style="text-align:left;">1.用switchStatus=1筛选出已开启的选项；<br><br>2.筛选是否是推荐提额（风险评估报告、会员提额对应code）。为什么不剔除已认证（会员提额：去购买会员页面/去提额页面，风险评估报告：调接口判断是否已认证完成还是跳三方页面购买服务）<br><br>3.剩余的都是优选提额，但是要剔除已经认证完成的选项</td></tr></tbody></table><h2 id="周周打卡数据" tabindex="-1">周周打卡数据 <a class="header-anchor" href="#周周打卡数据" aria-label="Permalink to &quot;周周打卡数据&quot;">​</a></h2><ul><li>接口：app/act/alive（林鑫）</li></ul><blockquote><p>背景：活动开关接口。为什么这个是单独接口，而不是和上面接口合并呢。提议过，被后端否决了，原因是，这个活动开关是跟着易借后台配置走的。这个就相当于公共的活动接口，所以activeType就是活动标识，但是返回的数据不仅仅是这个活动开关的配置，还有用户的数据。比如：用户的提额金额，用户是否已经参加过了。和原来的初衷不一致。</p></blockquote><table><thead><tr><th style="text-align:left;">字段</th><th style="text-align:center;">类型</th><th style="text-align:center;">含义</th><th style="text-align:left;">前端逻辑</th></tr></thead><tbody><tr><td style="text-align:left;">amount</td><td style="text-align:center;">number</td><td style="text-align:center;">用户已经拿到的提额福利金</td><td style="text-align:left;">/nothing</td></tr><tr><td style="text-align:left;">isAlive</td><td style="text-align:center;">&#39;0&#39;/&#39;1&#39;</td><td style="text-align:center;">活动开关</td><td style="text-align:left;">是string</td></tr><tr><td style="text-align:left;">participate</td><td style="text-align:center;">&#39;0&#39;/&#39;1&#39;/&#39;2&#39;</td><td style="text-align:center;">用户是否可参加</td><td style="text-align:left;">是string。1可以，0不可以, 2用户不可见。<br><br>为什么有isAlive，还要participate=2，跟后端提过，说isAlive只是表示活动状态，跟用户无关</td></tr></tbody></table><ol><li>用户点击&quot;试试手气&quot;按钮：会二次请求app/act/alive接口，为了判断活动的时效性</li><li>用户在试试手气的弹窗中，选择卡牌，会三次请求app/act/alive接口，为了更新用户的页面数据。</li></ol><ul><li>接口：app/act/raffle（翻卡牌获取金额 -- 林鑫）</li></ul><h2 id="客户端协议" tabindex="-1">客户端协议 <a class="header-anchor" href="#客户端协议" aria-label="Permalink to &quot;客户端协议&quot;">​</a></h2><ul><li>挽留弹窗</li><li>关闭webview（挽留弹窗点击离开）</li></ul><h2 id="附件" tabindex="-1">附件 <a class="header-anchor" href="#附件" aria-label="Permalink to &quot;附件&quot;">​</a></h2><p><img src="'+i+'" alt="首页2"></p>',14),s=[r];function d(c,o,h,y,g,x){return e(),l("div",null,s)}const _=t(n,[["render",d]]);export{u as __pageData,_ as default};
